	add("tracy", "{\"term\":\"tracy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A Norman baronial surname from places in France, derived from a Gallo-Roman given name \u0027Thracius\u0027 which referred to Thrace + the Celtic suffix \u0027*-āko\u0027 (place, property). As a female given name, it is also a diminutive of \u0027Theresa\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"occasional transferred use of the surname since the nineteenth century\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"popular in the 1960s and 1970s\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027 w:Evan Ed McBain, \u0027Snow White and Rose Red\u0027, page 130\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;That\u0027s her real name, you know. I mean, a lot of girls working the topless joints, they take exotic, sexy names...well, Tiffany Carter, for example...but that was the name \u0027\u0027Tracy\u0027\u0027 was born with.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027 Wayne C. Lee, \u0027Bad Men and Bad Towns\u0027, Caxton Press, ISBN 0870043498, page 144\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Her name was Theresa (often \u0027\u0027Tracy\u0027\u0027) Oldenburg and she had eyes only for another young man, Richard Puls\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A city in California\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A city in Minnesota\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A city in Missouri\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A village in New Brunswick, Canada\", \"priority\":10}]}, \"synonyms\":{}}");

