	add("trachelorrhaphy", "{\"term\":\"trachelorrhaphy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|trachel|rrhaphy|alt1\u003dtrachelo|gloss1\u003dcervix uteri|gloss2\u003dsuturing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The operation of sewing up a laceration of the neck of the uterus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1892\u0027\u0027, \u0027American Gynecological Journal\u0027 II, [http://books.google.co.uk/books?ei\u003dYVUaUK6qA6Ts0gXniYDoBg\u0026amp;id\u003d0m8xAQAAMAAJ\u0026amp;dq\u003d%22trachelorrhaphy%22\u0026amp;q\u003d%22trachelorrhaphy%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"search_anchor page 142\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We have had recently in gynecological work several “fads.” Sims’ cervix splitting, Emmet’s operation of \u0027\u0027trachelorrhaphy\u0027\u0027, divulsion of the cervix \u0027a la\u0027 Goodell, going the way of all “fads.”\", \"priority\":4}]}, \"synonyms\":{}}");

