	add("tracheophyte", "{\"term\":\"tracheophyte\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|trachea|phyte|t1\u003dxylem vessel|t2\u003dplant|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant possessing vascular tissue (xylem and phloem), including ferns, conifers, and flowering plants\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Karl J. Niklas, \u0027The Evolutionary Biology of Plants\u0027, [http://books.google.com.au/books?id\u003d2aSrw70rOKgC\u0026amp;pg\u003dPA179\u0026amp;dq\u003d%22tracheophyte%22%7C%22tracheophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dF7z5Uq_YPM6fkgXRqYHgDw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22tracheophyte%22%7C%22tracheophytes%22\u0026amp;f\u003dfalse page 179\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"By virtue of the presence and absence of vascular tissues, the \u0027\u0027tracheophytes\u0027\u0027 and the bryophytes were also considered two distinctly different levels of anatomical organization. Largely for these reasons, the bryophytes and the \u0027\u0027tracheophytes\u0027\u0027 are traditionally viewed as two distinct lineages, though they trace their evolutionary history back to a common ancestor\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, P. K. Strother, Thomas Servais, Marco Vecoli, \u0027The effect of terrestrialization on marine ecosystems: the fall of CO\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;\u0027, Marco Vecoli, Gaël Clément, B. Meyer-Berthaud (editors), \u0027The Terrestrialization Process\u0027, [http://books.google.com.au/books?id\u003dJi5JKDWYyE4C\u0026amp;pg\u003dPA40\u0026amp;dq\u003d%22tracheophyte%22%7C%22tracheophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dF7z5Uq_YPM6fkgXRqYHgDw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22tracheophyte%22%7C%22tracheophytes%22\u0026amp;f\u003dfalse page 40\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027tracheophytes\u0027\u0027 (vascular land plants) have a fossil record beginning in the Wenlock (Edwards et al. 1983\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Philippe Steemans, Elodie Petus, Pierre Breuer, Paula Mauller-Mendlowicz, Philippe Gerrienne, \u0027Paleozoic Innovations in the Micro- and Megafossil Plant Record: From the Earliest Plant Spores to the Earliest Seeds\u0027, John A. Talent (editor), \u0027Earth and Life: Global Biodiversity, Extinction Intervals and Biogeographic Perturbations Through Time\u0027, [http://books.google.com.au/books?id\u003dzzW70nyLLXUC\u0026amp;pg\u003dPA443\u0026amp;dq\u003d%22tracheophyte%22%7C%22tracheophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dF7z5Uq_YPM6fkgXRqYHgDw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22tracheophyte%22%7C%22tracheophytes%22\u0026amp;f\u003dfalse page 443\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"There is a clear relationship between \u0027\u0027tracheophytes\u0027\u0027 and trilete spores, but not with cryptospores\", \"priority\":10}]}, \"synonyms\":{}}");

	add("trachyte", "{\"term\":\"trachyte\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027trachyte\u0027 from Ancient greek (to 1453) \u0027τραχύς\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pale igneous rock consisting mostly of potassium feldspar and plagioclase\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Earth\u0027, Folio Society 2011, p. 52\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The type of rock that results is often described as \u0027\u0027trachyte\u0027\u0027 and contains abundant crystals of a different kind of alkali-rich feldspar, such as sanidine, rather than plagioclase\", \"priority\":3}]}, \"synonyms\":{}}");

