	add("tractator", "{\"term\":\"tractator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027tractātor\u0027 (manager, homilist)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In medieval commerce, the person who handles or transports merchandise on behalf of an investor; an entrepreneur\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, John H. Pryor, \u0027Commerce, Shipping and Naval Warfare in the Medieval Mediterranean\u0027, page 17\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As well as being greatly useful to \u0027\u0027tractators\u0027\u0027 who wanted to go on to further voyages or to stay overseas for a longer period, it was also indispensable when a \u0027\u0027tractator\u0027\u0027 fell ill or died\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person who writes tracts\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A Tractarian\", \"priority\":5}]}, \"synonyms\":{}}");

	add("traction", "{\"term\":\"traction\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From {{m|la|tractio}}, from Latin \u0027tractus\u0027 perfect passive participle of verb \u0027trahere\u0027 (pull) + noun of action suffix \u0027-io\u0027 (genitive \u0027-ionis\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of pulling something along a surface using motive power\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the condition of being so pulled\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The pulling power of an engine or animal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The adhesive friction of a wheel etc on a surface\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A mechanically applied sustained pull, especially to a limb\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Collectively, the locomotives of a railroad, especially electric locomotives\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Progress in or momentum toward achieving a goal\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The extent of adoption of a new product or service, typically measured in number of customers or level of revenue achieved\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Popular support\", \"priority\":9}]}, \"synonyms\":{}}");

