	add("tradition", "{\"term\":\"tradition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027tradicion\u0027 from Latin \u0027trāditiō\u0027 () from the verb \u0027trādere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A part of culture that is passed from person to person or generation to generation, possibly differing in detail from family to family, such as the way to celebrate holidays\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A commonly held system\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of delivering into the hands of another; delivery\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Blackston\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A deed takes effect only from the \u0027\u0027tradition\u0027\u0027 or delivery\", \"priority\":5}]}, \"synonyms\":{}}");

