	add("traducianism", "{\"term\":\"traducianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|traducian|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The doctrine that the soul or spirit is inherited from one or both parents\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Roy Porter, \u0027Flesh in the Age of Reason\u0027, Penguin (2004), page 37\u0027n\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Augustine\u0027s insistence on its spiritual nature made it hard for him to uphold, along with Tertullian, the doctrine of physical \u0027\u0027traducianism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 145\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Tertullian suggested that the human soul is transmitted by parents to their children and is therefore inescapably associated with continuing human sin: this doctrine of ‘\u0027\u0027traducianism\u0027\u0027’ underlay the pessimistic view of the human condition and its imprisonment in original sin which was presented in an extreme form by that later theological giant from North Africa, Augustine of Hippo\", \"priority\":5}]}, \"synonyms\":{}}");

	add("traductology", "{\"term\":\"traductology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027traductologie\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the theory and practice of translating and interpreting, especially in an academic context, combining elements of social science and the humanities. More commonly known as translation studies or translatology\", \"priority\":1}]}, \"synonyms\":{}}");

