	add("traffic", "{\"term\":\"traffic\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"Arabic\", \"English\", \"middle french (ca. 1400-1600)\", \"Italian\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027trafique\u0027 (traffic) from Italian \u0027traffico\u0027 (traffic) from Italian \u0027trafficare\u0027 (to carry on trade) Potentially from {{m|la|*transfricare||to rub across}}; Klein instead suggests the Italian has ultimate origin in Arabic \u0027تفريق\u0027 (distribution, dispersion) reshaped to match the native prefix \u0027tra-\u0027 (trans-)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Pedestrians or vehicles on roads, or the flux or passage thereof\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Traffic is slow at rush hour\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Commercial transportation or exchange of goods, or the movement of passengers or people\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1719\u0027\u0027, w:Daniel Daniel Defoe, \u0027w:Robinson Robinson Crusoe\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I had three large axes, and abundance of hatchets (for we carried the hatchets for \u0027\u0027traffic\u0027\u0027 with the Indians\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, John Darwin, \u0027After Tamerlane\u0027, Penguin 2008, p. 12\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s units of study are regions or oceans, long-distance trades [...], the \u0027\u0027traffic\u0027\u0027 of cults and beliefs between cultures and continents\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Illegal trade or exchange of goods, often drugs\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Exchange or flux of information, messages or data, as in a computer or telephone network\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Commodities of the market\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"John Ga\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"You\u0027ll see a draggled damsel / From Billingsgate her fishy \u0027\u0027traffic\u0027\u0027 bear\", \"priority\":12}]}, \"synonyms\":{}}");

