	add("tragedy", "{\"term\":\"tragedy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From the Middle english (1100-1500) \u0027tragedie\u0027 from the Old french (842-ca. 1400) \u0027tragedie\u0027 from the Latin \u0027tragoedia\u0027 from the Ancient greek (to 1453) \u0027τραγῳδία\u0027 (epic play, tragedy) from \u0027τράγος\u0027 (male goat) + \u0027ᾠδή\u0027 (song) a reference to the goat-satyrs of the theatrical plays of the Dorians.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A drama or similar work, in which the main character is brought to ruin or otherwise suffers the extreme consequences of some tragic flaw or weakness of character\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The genre of such works, and the art of producing them\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A disastrous event, especially one involving great loss of life or injury\", \"priority\":3}]}, \"synonyms\":{}}");

