	add("trahison", "{\"term\":\"trahison\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027trahison\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Treason\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, \u0027Hitch-22\u0027, Atlantic 2010, p. 270\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That this \u0027\u0027\u0027trahison\u0027\u0027\u0027 would take a partly “multicultural” form was also something that was slowly ceasing to surprise me\", \"priority\":3}]}, \"synonyms\":{}}");

	add("trait", "{\"term\":\"trait\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) from Latin \u0027tractus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an identifying characteristic, habit or tren\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The number one personality \u0027\u0027trait\u0027\u0027 I hate is hypocrisy. Why can\u0027t you be consistent\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In object-oriented programming, an uninstantiable collection of methods that provides functionality to a class by using the class’s own interface\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Traits\u0027\u0027 are somewhat between an interface and a mixin, as an interface contains only method signatures, while a \u0027\u0027trait\u0027\u0027 includes also the full method definitions, on the other side mixins include method definitions, but they can also carry state through attributes, while \u0027\u0027traits\u0027\u0027 usually don\u0027t\", \"priority\":4}]}, \"synonyms\":{}}");

