	add("trainiac", "{\"term\":\"trainiac\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|train|maniac|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A railway enthusiast\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Kathie Weir, \u0027A Parent\u0027s Guide to Los Angeles: Friendly Advice for Touring Los Angeles with Children\u0027, Mars Publishing, Inc. (2001), ISBN 9780967512716, [http://books.google.com/books?id\u003d5wBNY343WWQC\u0026amp;q\u003d%22trainiac%22 page 29\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Lomita Railroad Museum was once a regular stop on our shopping trips, a little reward for my \u0027\u0027trainiac\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, James B. Twitchell, \u0027Where Men Hide\u0027, Columbia University Press (2006), ISBN 9780231137348, [http://books.google.com/books?id\u003dLs9fhLGUkg4C\u0026amp;pg\u003dPA77 page 77\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There are still \u0027\u0027trainiacs\u0027\u0027, for sure — approximately 300,000 hardcore train hobbyists in the United States, who spend about $500 million on their passion\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027 September 29, Chuck Lorre, Eric Kaplan \u0026amp; Jim Reynolds, \u0026quot;The Pulled Groin Extrapolation\u0026quot;, episode 5-3 of \u0027w:The Big Bang The Big Bang Theory\u0027, 00:10:27-00:10:32\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Sheldon Cooper:\u0026lt;/span\u0026gt; It\u0027s official. I\u0027m an HO \u0027\u0027trainiac\u0027\u0027.\u0026lt;br /\u0026gt\", \"priority\":7}]}, \"synonyms\":{}}");

	add("training", "{\"term\":\"training\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Action of the verb \u0027to train\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The activity of imparting and acquiring skills\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The result of good social upbringing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The process by which two modems determine which protocol and speed to use; handshaking\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"voice recognition\u0027) The recording of multiple samples of a user\u0027s voice to aid pattern recognition\", \"priority\":5}]}, \"synonyms\":{}}");

	add("trainload", "{\"term\":\"trainload\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|train|load|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The amount that can be transported by a train\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large amount\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You just bought yourself a \u0027\u0027trainload\u0027\u0027 of trouble. I think you\u0027re now in over one\u0027s over your head\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1926\u0027\u0027, Gerald William Bullett, \u0027The Baker\u0027s Cart: And Other Tales\u0027, page 16\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A shudder ran through Mr. Binnacle. Better a whole \u0027\u0027trainload\u0027\u0027 of invigilators than this grotesque and solitary persecutor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Mary Seaton, \u0027Tales From The Sand Hills\u0027, page 4\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"They were peculiar people, slow. Well more backwards I think, probably a bit retarded. Well very retarded actually - the father had a few \u0027roos loose in the top paddock but the mother had a whole \u0027\u0027trainload\", \"priority\":7}]}, \"synonyms\":{}}");

