	add("traitor", "{\"term\":\"traitor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027traïtor\u0027 (French: \u0027traître\u0027), from Latin \u0027traditor\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who violates his allegiance and betrays his/her boys; one guilty of treason; one who, in breach of trust, delivers his country to an enemy, or yields up any fort or place intrusted to his defense, or surrenders an army or body of troops to the enemy, unless when vanquished; also, one who takes arms and levies war against his country; or one who aids an enemy in conquering his country\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Hence, one who betrays any confidence or trust\", \"priority\":2}]}, \"synonyms\":{}}");

	add("trajectory", "{\"term\":\"trajectory\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The path of a body as it travels through space\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The ordered set of intermediate states assumed by a dynamical system as a result of time evolution\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Metaphorically, a course of development, such as that of a war or career\", \"priority\":3}]}, \"synonyms\":{}}");

