	add("tramcar", "{\"term\":\"tramcar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|tram|car|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A streetcar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A rail vehicle for carrying loads in a mine; a tram\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We arrived at level 15 where we piled into a battery powered \u0027\u0027tramcar\u0027\u0027 for a ten minute ride to the section of the mine we would be visiting. Packed into the tram we realized why the gigantic cooling and ventilation systems on the surface pumps 550 cubic meters of air into the mine each second\", \"priority\":3}]}, \"synonyms\":{}}");

	add("trammel", "{\"term\":\"trammel\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027tramail\u0027 (net for catching fishes) from \u0027tremaculum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Whatever impedes activity, progress, or freedom, as a net or shackle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"They] disdain the trammels of any sordid contract\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A fishing net that has large mesh at the edges and smaller mesh in the middl\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A kind of net for catching birds, fishes, or other prey\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A set of rings or other hanging devices, attached to a transverse bar suspended over a fire, used to hang cooking pots etc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A net for confining a woman\u0027s hair\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A kind of shackle used for regulating the motions of a horse and making him amble\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An instrument for drawing ellipses, one part of which consists of a cross with two grooves at right angles to each other, the other being a beam carrying two pins (which slide in those grooves), and also the describing pencil\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A beam compass\", \"priority\":9}]}, \"synonyms\":{}}");

	add("tramper", "{\"term\":\"tramper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|tramp|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who tramps\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A recreational hiker\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Linda Barnard, \u0026quot;Train trek carries travellers over New Zealand\u0027s alpine backbone,\u0026quot; \u0027Toronto Star\u0027, 29 Dec., p. T9\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s a popular spot for hikers, or \u0027\u0027trampers\u0027\u0027 as they call them here\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A mechanism which pounds material into a more compact form for further processing; found for example in cotton gins and trash processors\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A ship, typically a bulk freighter, which does not travel on a fixed route; compare liner\", \"priority\":6}]}, \"synonyms\":{}}");

	add("trampoline", "{\"term\":\"trampoline\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Italian\"], \"text\":\"From Spanish \u0027trampolín\u0027 and/or Italian \u0027trampolino\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A gymnastic and recreational device consisting of a piece of taut, strong fabric stretched over a steel frame using many coiled springs as anchors\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of a variety of looping or jumping instructions in specific programming languages\", \"priority\":2}]}, \"synonyms\":{}}");

	add("tramway", "{\"term\":\"tramway\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|tram|way|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the track on which a tram (streetcar) run\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the system of cables that supports a cable car\", \"priority\":2}]}, \"synonyms\":{}}");

	add("tranq", "{\"term\":\"tranq\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tranquilizer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Sue Grafton, \u0027A is for Alibi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;I gave her a \u0027\u0027tranq\u0027\u0027,\u0026quot; he said with anguish. \u0026quot;She asked for one and I found this bottle in the medicine cabinet and gave it to her.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Sisters of Mercy, \u0027Alice\u0027 (song\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She needs you like she needs her \u0027\u0027tranqs\u0027\u0027 / To tell her that the world is clean\", \"priority\":5}]}, \"synonyms\":{}}");

