	add("tranny", "{\"term\":\"tranny\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"All are shortened forms as indicated.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A transsexual, transgender or transvestite person, usually a trans woman\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Short form of transistor radio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Short form of transmission\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Short form of transformer\", \"priority\":4}]}, \"synonyms\":{}}");

	add("tranquillity", "{\"term\":\"tranquillity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027tranquilite\u0027 from Latin \u0027tranquillitās\u0027 from \u0027tranquillus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state of being tranqui\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the absence of disturbance; peacefulnes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the absence of stress; serenit\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the quality of calm such as that experienced in places with mainly natural features and activities, free from disturbance from manmade ones\", \"priority\":4}]}, \"synonyms\":{}}");

	add("transaction", "{\"term\":\"transaction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle french (ca. 1400-1600) from Old french (842-ca. 1400) \u0027transaccion\u0027 from \u0027transactio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of conducting or carrying out (business, negotiations, plans\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A deal or business agreement\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An exchange or trade, as of ideas, money, goods, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The transfer of funds into, out of, or from an account\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An atomic operation; a message, data modification, or other procedure that is guaranteed to perform completely or not at all (e.g. a database transaction\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A record of the proceedings of a learned society\", \"priority\":6}]}, \"synonyms\":{}}");

