	add("transaxle", "{\"term\":\"transaxle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|transmission|axle|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A single unit combining transmission gearbox, clutch, final drive, and differential are combined into a single unit connected directly to the driveshaft, used mostly in rear-engine cars\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transbaikal", "{\"term\":\"transbaikal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|Baikal|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"mountainous region to the east of or \u0026quot;beyond\u0026quot; (trans-) Lake Baikal in Russia\", \"priority\":1}]}, \"synonyms\":{}}");

