	add("transcaucasia", "{\"term\":\"transcaucasia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|trans|Caucasus|lang\u003den}}, translation of Russian \u0027закавказье\u0027 (sc\u003dcyrl) \u0026quot;beyond Caucasus mountains\u0026quot;, as viewed from the side of Russia.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mountainous region of southwest Asia, lying south of Caucasus Mountains and comprising republics of Georgia, Armenia and Azerbaijan. Also known as South Caucasus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transcendence", "{\"term\":\"transcendence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transcend|ence|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of surpassing usual limit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the state of being beyond the range of normal perceptio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the state of being free from the constraints of the material world, as in the case of a deit\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"superior excellence; supereminenc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A. V. G. Alle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Augustinian theology rests upon the \u0027\u0027transcendence\u0027\u0027 of Deity at its controlling principle\", \"priority\":6}]}, \"synonyms\":{}}");

	add("transcendental", "{\"term\":\"transcendental\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A transcendentalist\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transcendentalism", "{\"term\":\"transcendentalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transcending, or going beyond, empiricism, and ascertaining a priori the fundamental principles of human knowledge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Ambitious and imaginative vagueness in thought, imagery, or diction\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A philosophy which holds that reasoning is key to understanding reality (associated with Kant); philosophy which stresses intuition and spirituality (associated with Ralph Waldo Emerson); transcendental character or quality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A movement of writers and philosophers in New England in the 19th century who were loosely bound together by adherence to an idealistic system of thought based on a belief in the essential supremacy of insight over logic and experience for the revelation of the deepest truths\", \"priority\":4}]}, \"synonyms\":{}}");

	add("transcendentalist", "{\"term\":\"transcendentalist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transcendental|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who believes in transcendentalism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A group of philosophers who assert that true knowledge is obtained by faculties of the mind that transcend sensory experience; those who exalt intuition above empirical knowledge and ordinary mentation. Used in modern times of some post-Kantian German philosophers, and of the school of Emerson\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transcendentality", "{\"term\":\"transcendentality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transcendental|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being transcendental\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transcendentalness", "{\"term\":\"transcendentalness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transcendental|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being transcendental\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transcender", "{\"term\":\"transcender\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transcend|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who transcends\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Antoine Culioli, ‎Michel Liddle, \u0027Cognition and Representation in Linguistic Theory\u0027 (page v\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"British and North American practitioners tend to ignore the heirs, gainsayers and \u0027\u0027transcenders\u0027\u0027 of the framework set out by Ferdinand de Saussure\", \"priority\":3}]}, \"synonyms\":{}}");

	add("transcompilation", "{\"term\":\"transcompilation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|compilation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The translation of source code in one programming language into source code for another programming language\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transcompiler", "{\"term\":\"transcompiler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|compiler|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of compiler that takes the source code of a programming language as its input and outputs the source code into another programming language\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transcript", "{\"term\":\"transcript\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027transcriptum\u0027 (from \u0027transcribere\u0027).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something which has been transcribed; a writing or composition consisting of the same words as the original; a written copy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A copy of any kind; an imitation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A written version of what was said orally; as, a transcript of a trial\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sequence of RNA produced by transcriptio\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An inventory of the courses taken and grades earned of a student alleged throughout a course\", \"priority\":5}]}, \"synonyms\":{}}");

	add("transcription", "{\"term\":\"transcription\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027transcriptio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of transcribing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something that has been transcribed, including\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An adaptation of a composition\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"These w:frame frame tale interludes frequently include \u0027\u0027transcriptions\u0027\u0027 of Italian folk songs\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A recorded radio or television programme\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A representation of speech sounds as phonetic symbols\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The synthesis of RNA under the direction of DNA\", \"priority\":7}]}, \"synonyms\":{}}");

	add("transcriptionist", "{\"term\":\"transcriptionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transcription|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who transcribes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A writer of transcripts\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transcriptome", "{\"term\":\"transcriptome\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transcript|ome|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The complete set of RNA molecules (transcripts) produced in a cell or a population of cells\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transducer", "{\"term\":\"transducer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transduce|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device that converts energy from one form into another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A state machine that generates output based on a given input\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transduction", "{\"term\":\"transduction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transduce|tion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transfer of genetic material from one bacterial cell to another by a bacteriophage or plasmi\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process whereby a transducer converts energy from one form to anothe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The conversion of a stimulus from one form to anothe\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The conversion of energy (especially light energy) into another form, especially in a biological process such as photosynthesis or in a transduce\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A form of inference involving reasoning from one specific case to another (compare induction\", \"priority\":5}]}, \"synonyms\":{}}");

	add("transelevator", "{\"term\":\"transelevator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|elevator|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An automated system used to move, store and retrieve objects in an automated warehouse\", \"priority\":1}]}, \"synonyms\":{}}");

