	add("transfix", "{\"term\":\"transfix\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027transfixer\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A discontinuous affix, which occurs at more than one position in a word, typical of Semitic languages\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transformability", "{\"term\":\"transformability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being transformable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transformationalism", "{\"term\":\"transformationalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transformational|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Adherence to transformational grammars\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fusion of evangelicalism, Pentecostalism, and ecumenism that became prominent in the early 21st century\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sociological and educational theory that focuses on the process of learned concepts and skills to reframe and transform unthinking culturally-generated assumptions and cognitive categories\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The belief in the transformative power of Confucian culture as a superior system that can be universally applied to all people\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A political theory that emphasizes assimilation as a process of global cultural convergence\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A theory proposed by Robinet in the 18\u0026lt;sup\u0026gt;th\u0026lt;/sup\u0026gt; century that posits a single, created prototype for all species of plants and animals\", \"priority\":6}]}, \"synonyms\":{}}");

	add("transformationalist", "{\"term\":\"transformationalist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transformational|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A linguist who favours transformational grammars\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An adherent or believer in transformationalism (any sense\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transformer", "{\"term\":\"transformer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|transform}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that transforms, changing its own or another thing\u0027s shape\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A static device that transfers electric energy from one circuit to another by magnetic coupling. Their main use is to transfer energy between different voltage levels, which allows choosing most appropriate voltage for power generation, transmission and distribution separately\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transfuser", "{\"term\":\"transfuser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transfuse|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who transfuses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A device for performing transfusion\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transfusion", "{\"term\":\"transfusion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transfer of blood or blood products from one individual to another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of pouring liquid from one vessel to another\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transgenderism", "{\"term\":\"transgenderism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transgender|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being transgender\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transgenesis", "{\"term\":\"transgenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|trans|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of introducing an exogenous gene into a living organism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transgression", "{\"term\":\"transgression\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027transgression\u0027 from \u0027trānsgressiō\u0027 from Latin \u0027trānsgressus\u0027 (perfect active participle of {{m|la|trānsgredior||I step across}}) + {{m|la|-iō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A violation of a law, duty or commandmen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An act that goes beyond generally accepted boundarie\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A relative rise in sea level resulting in deposition of marine strata over terrestrial strata\", \"priority\":3}]}, \"synonyms\":{}}");

	add("transhistorical", "{\"term\":\"transhistorical\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* \u0027trans\u0027 + \u0027history\u0027 + \u0027-al\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Outside the bounds of history; universal; permanent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Michael Cronin, \u0027Training For The New Millennium\u0027, edited by Martha Tennent, John Benjamins Publishing Co, p. 259\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An assumption made in much translation pedagogy is that... students are always and everywhere the same. In other words, the student is an invariant, \u0027\u0027transhistorical\u0027\u0027 subject who is, to all intents and purposes, indistinguishable from his or her counterpart in the seventeenth, eighteenth or nineteenth century\", \"priority\":3}]}, \"synonyms\":{}}");

	add("transhistoricity", "{\"term\":\"transhistoricity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* \u0027trans\u0027 + \u0027history\u0027 + \u0027-icity\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of an entity or concept that has always existed and is not merely confined to one particular stage of human history\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transhumance", "{\"term\":\"transhumance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027transhumance\u0027 ultimately from Latin \u0027trāns\u0027 (across, beyond) + \u0027humus\u0027 (ground)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The seasonal movement of people, with their cattle or other grazing animals, to new pastures which may be quite distant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 June 17, C. J. Moore, \u0026quot;[http://www.nytimes.com/2005/06/16/opinion/16iht-edmoore.html Meanwhile: With a hop-hop-hop and a bottle of Swiss bubbly],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 20 Aug 2014)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There are rites of spring in the mountains, and this week I followed the \u0027\u0027transhumance\u0027\u0027, the annual movement of cattle, from their lower valley winter quarters up to the higher pastures\", \"priority\":3}]}, \"synonyms\":{}}");

	add("transistor", "{\"term\":\"transistor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"blend|Blend of \u0027transconductance\u0027 (or \u0027transfer\u0027) and \u0027resistor\u0027\u0026lt;!--Etymology from Wikipedia as of 2005-11-17. This etymology does not fit into the {{blend|x|y}} template so has been written out in full.--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a solid-state semiconductor device, with three terminals, which can be used for amplification, switching, voltage stabilization, signal modulation, and many other function\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a transistor radio\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transit", "{\"term\":\"transit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French from Latin \u0027lang\u003dla|transire\u0027 () from \u0027lang\u003dla|trans\u0027 () + \u0027lang\u003dla|ire\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of passing over, across, or through something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In France you are now in the \u0027\u0027transit\u0027\u0027 from one form of government to another\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The conveyance of people or goods from one place to another, especially on a public transportation system; the vehicles used for such conveyance\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027transit\u0027\u0027 of goods through a country\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The passage of a celestial body across the observer\u0027s meridian, or across the disk of a larger celestial body\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A surveying instrument rather like a theodolite that measures horizontal and vertical angles\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"an imaginary line between two objects whose positions are known. When the navigator sees one object directly in front of the other, the navigator knows that his position is on the transit\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a w:Ford Ford Transit van. \u0026lt;!--really uncapitalised?!--\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"to carry communications traffic to and from a customer or another network on a compensation basis as opposed to peerage in which the traffic to and from another network is carried on an equivalency basis or without charge\", \"priority\":9}]}, \"synonyms\":{}}");

	add("transition", "{\"term\":\"transition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027transition\u0027 from Latin \u0027transitio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of change from one form, state, style or place to another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dAll this was extraordinarily distasteful to Churchill.Never before had he felt such repulsion when the vicar displayed his characteristic bluntness or coarseness of speech. In the present connexion\u0026amp;mdash;or rather as a \u0027\u0027transition\u0027\u0027 from the subject that started their conversation\u0026amp;mdash;such talk had been distressingly out of place\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A word or phrase connecting one part of a discourse to another\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A brief modulation; a passage connecting two themes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A point mutation in which one base is replaced by another of the same class (purine or pyrimidine); compare transversion\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A change from defense to attack, or attack to defense\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The onset of the final stage of childbirth\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Professional special education assistance for children or adults in the process of leaving one educational environment or support program for another to relatively more independent living\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A change between forward and backward motion without stopping\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The process or act of changing from one gender role to another, or of bringing one\u0027s outward appearance in line with one\u0027s internal gender identity\", \"priority\":10}]}, \"synonyms\":{}}");

	add("transitology", "{\"term\":\"transitology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transit|ology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the process of change from one political regime to another\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transitoriness", "{\"term\":\"transitoriness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|transitory|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being transitory\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transjordan", "{\"term\":\"transjordan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|Jordan|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A British protectorate established in 1921 east of the River Jordan, now forming the main part of the kingdom of Jordan\", \"priority\":1}]}, \"synonyms\":{}}");

	add("translatability", "{\"term\":\"translatability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or property of being translatable; ability to be translated\", \"priority\":1}]}, \"synonyms\":{}}");

	add("translatableness", "{\"term\":\"translatableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or property of being translatable; ability to be translated\", \"priority\":1}]}, \"synonyms\":{}}");

	add("translatese", "{\"term\":\"translatese\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|translate|ese|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Awkwardness or ungrammaticality of translation, such as due to overly literal translation of idioms or syntax\", \"priority\":1}]}, \"synonyms\":{}}");

	add("translation", "{\"term\":\"translation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027translacioun\u0027 from Old french (842-ca. 1400) \u0027translacion\u0027 (transfer, translation) from Latin {{m|la|trānslātiō||transfer}}, from {{m|la|trans-||across}}, + {{m|la|lātiō||carrying}}, from {{m|la|lātus}}, perfect passive participle of irregular verb {{m|la|ferō}} (compare \u0027\u0027transfer\u0027\u0027), + noun of action suffix {{m|la|-iō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or an act of translating, in its various senses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The conversion of text from one language to another\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The conversion of something from one form or medium to another\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A motion or compulsion to motion in a straight line without rotation or other deformation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The process whereby a strand of mRNA directs assembly of amino acids into proteins within a ribosome\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A transfer of motion occurring within a gearbox\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The conveyance of something from one place to another, especially\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An ascension to Heaven without death\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A transfer of a bishop from one diocese to another\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A transfer of a holy relic from one shrine to another\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A transfer of a disease from one body part to another\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The product or end result of an act of translating, in its various senses\", \"priority\":12}]}, \"synonyms\":{}}");

	add("translationese", "{\"term\":\"translationese\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|translation|ese|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Awkwardness or ungrammaticality of translation, such as due to overly literal translation of idioms or syntax\", \"priority\":1}]}, \"synonyms\":{}}");

	add("translatology", "{\"term\":\"translatology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* \u0027translation\u0027 + \u0027-ology\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the theory and practice of translating and interpreting, especially in an academic context, combining elements of social science and the humanities. Also known as translation studies or traductology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("translatome", "{\"term\":\"translatome\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|translate|ome|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The totality of proteins formed by translation of mRNA\", \"priority\":1}]}, \"synonyms\":{}}");

	add("translator", "{\"term\":\"translator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) from Latin {{m|la|trānslātor}}, agent noun from perfect passive participle {{m|la|trānslātus}}, from {{m|la|trānsferō||carry across}}, from \u0027trans\u0027 (across, beyond) + {{m|la|ferō||bear, carry}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who translates text, film or other material into a different natural language\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One that makes a new version of a source material in a different language or format\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A language interpreter\", \"priority\":3}]}, \"synonyms\":{}}");

	add("translatorese", "{\"term\":\"translatorese\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|translator|ese|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Stilted or unidiomatic language produced by automated translation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("translatrix", "{\"term\":\"translatrix\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027translator\u0027 + \u0027-rix\u0027 as a regular Latinate formation of the feminine agent noun\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;\u0026gt;“[http://dictionary.oed.com/cgi/entry/50256332 transˈlatrix]” listed in the \u0027\u0027Oxford English Dictionary\u0027\u0027 [2\u0026lt;sup\u0026gt;nd\u0026lt;/sup\u0026gt; Ed.; 1989]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman, girl, or other female who translates; a specifically female translator\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transliteracy", "{\"term\":\"transliteracy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|literacy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability to read, write and interact across a range of platforms and media\", \"priority\":1}]}, \"synonyms\":{}}");

	add("translocation", "{\"term\":\"translocation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|location|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Removal of things from one place to another; displacement; substitution of one thing for another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There happened certain \u0027\u0027translocations\u0027\u0027 at the deluge.\u0027 \u0026amp;mdash; Woodward\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A transfer of a chromosomal segment to a new position, especially on a nonhomologous chromosome; the segment so transferred\", \"priority\":3}]}, \"synonyms\":{}}");

	add("translocator", "{\"term\":\"translocator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|translocate|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A translocon\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transmisogyny", "{\"term\":\"transmisogyny\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|misogyny|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Diane Railton \u0026amp; Paul Watson, \u0027Music Video and the Politics of Representation\u0027, Edinburgh University Press (2011), ISBN 9780748633227, [http://books.google.ca/books?id\u003dFjcKyoB78DEC\u0026amp;pg\u003dPA146\u0026amp;dq\u003d%22transmisogyny%22 page 146\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The blog critic gudbuy t\u0027jane is even more scathing in her condemnation of the video in arguing that the fact that Lady Gaga \u0027uses trans women and drag queens to exoticize her videos doesn\u0027t defer from the cissupremacist stance that women\u003dvagina, and trans women are therefore not real women . . . This is \u0027\u0027transmisogyny\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Julia Serano, in \u0027F \u0027em!: Goo Goo, Gaga, and Some Thoughts on Balls\u0027 (ed. Jennifer Baumgardner), Seal Press (2011), ISBN 9781580053600, [http://books.google.com/books?id\u003ddPj1dOybRLEC\u0026amp;pg\u003dPA199\u0026amp;dq\u003d%22transmisogyny%22 page 199\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I talk about “\u0027\u0027transmisogyny\u0027\u0027” in my book, which is the intersection of being trans and experiencing misogyny. As a trans woman, I don\u0027t just experience how our culture devalues femininity—I\u0027m treated as a fake woman\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Shiri Eisner, \u0027Bi: Notes for a Bisexual Revolution\u0027, Seal Press (2013), ISBN 9781580054751, [http://books.google.com/books?id\u003dCbJaZIosLwQC\u0026amp;pg\u003dPT93\u0026amp;dq\u003d%22transmisogyny%2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22transmisogyny%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As to bisexual trans woman, in addition to all of the above, they are also subject to a whole other set of sexual harassment and violence as a result of transphobia and \u0027\u0027transmisogyny\u0027\u0027 (this goes especially for trans women of color\", \"priority\":7}]}, \"synonyms\":{}}");

	add("transmissionism", "{\"term\":\"transmissionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transmission|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A teaching style focused on transmitting facts without regard to the individual student\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Valerie Pellatt, ‎Kate Griffiths, ‎Shao-Chuan Wu, \u0027Teaching and Testing Interpreting and Translating\u0027 (page 156\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Teaching and learning methods were therefore forced to perpetuate \u0027\u0027transmissionism\u0027\u0027 and traditional assessment approaches, given that attention to the individual was completely out of question\", \"priority\":3}]}, \"synonyms\":{}}");

	add("transmutability", "{\"term\":\"transmutability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability to be transmuted\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transmutation", "{\"term\":\"transmutation\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027transmutation\u0027 or its source, \u0027transmutationem\u0027 from Latin \u0027transmutare\u0027 (to change)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Change, alteration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The conversion of one thing into something else; transformation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the supposed transformation of one element into another, especially of a base metal into gold\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society 2012, p. 261\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027transmutation\u0027\u0027 of metals was secondary to the main aim, which was the spiritual transformation of the adept\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The actual transformation of one element into another by a nuclear reaction.Category:en:Fictional abilities\", \"priority\":6}]}, \"synonyms\":{}}");

	add("transmuter", "{\"term\":\"transmuter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transmute|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, transmutes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Lawrence Principe, ‎Lloyd DeWitt, \u0027Transmutations\u0027 (page 8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Hopeful \u0027\u0027transmuters\u0027\u0027 of metals thus became associated with counterfeiters and forgers. Accordingly, during his tour of the Inferno, Dante meets two alchemists deep in the eighth circle of Hell\", \"priority\":3}]}, \"synonyms\":{}}");

	add("transnistria", "{\"term\":\"transnistria\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Literally \u0026quot;beyond the river Dniester\u0026quot;. {{etystub|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A governorate of Romania during World War II, established in 1941 and captured by Soviet forces in 1944\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An autonomous territory within Moldova, not internationally recognized as a nation\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transparency", "{\"term\":\"transparency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transparent|cy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a transparent object\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"specifically\u0027, a transparent material with an image on it, that is viewable by shining light through it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"openness, degree of accessibility to vie\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the quality of being transparent; transparence\", \"priority\":4}]}, \"synonyms\":{}}");

	add("transplanter", "{\"term\":\"transplanter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transplant|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who transplants\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A machine for transplanting trees\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transponder", "{\"term\":\"transponder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|transmitter|responder|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A radio or radar transceiver that transmits some signal in response to receiving a predetermined signal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transpondian", "{\"term\":\"transpondian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Jocular coinage from {{prefix|trans||lang\u003den}} \u0027the pond\u0027 () {{suffix||ian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone from the other side of the Atlantic Ocean, especially the British Isles or the United States\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transportation", "{\"term\":\"transportation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|transport|ation|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of transporting, or the state of being transported; conveyance, often of people, goods etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We have to get people out of their cars and encourage them to use alternative forms of \u0027\u0027transportation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Deportation to a penal colony\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Mulligan\u0027s sentence was commuted from death to \u0027\u0027transportation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A means of conveyance\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Nice \u0027\u0027transportation\u0027\u0027, dude, but your brake lights are busted\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A ticket or fare\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027, Willa Cather, \u0027The Westbound Train\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Sybil: [..] That reminds me, I haven\u0027t got my passes yet! Have you the \u0027\u0027transportation\u0027\u0027 here from Cheyenne to San Francisco for Mrs. S. Johnston?\u0026quot\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Agent looks grave, goes back and fumbles at the papers on his desk, returns to the window with a slip of paper in his hand\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Agent: \u0026quot;We had \u0027\u0027transportation\u0027\u0027 here made out for such a person, but it was called for several hours ago.\u0026quot\", \"priority\":11}]}, \"synonyms\":{}}");

	add("transportin", "{\"term\":\"transportin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transport|in|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a family of proteins involved with the karyopherin receptor complex\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transrealism", "{\"term\":\"transrealism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A literary mode that mixes the techniques of incorporating fantastic elements used in science fiction with the techniques of describing immediate perceptions from naturalistic realism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transsex", "{\"term\":\"transsex\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|sex|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Transsexuality, transsexualism; the state of being transsexual\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Alison Stone, \u0027An Introduction to Feminist Philosophy\u0027 (ISBN 074563883X), page 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Before we can answer this question, we need to consider two other phenomena – \u0027\u0027transsex\u0027\u0027 and transgender – which also expose the muddle within conventional categories of sex\", \"priority\":3}]}, \"synonyms\":{}}");

	add("transsexualism", "{\"term\":\"transsexualism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Transsexuality; the state of being transsexual\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, A. Spencer Bergstedt, \u0027Transition and Beyond\u0027 (page 28\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Transfolk are not covered in any applicable laws like Title VII or the ADA - in fact, \u0027\u0027transsexualism\u0027\u0027 is explicitly excluded from the ADA. Therefore, you have no causes of action against an employer based on federal law\", \"priority\":3}]}, \"synonyms\":{}}");

	add("transsexuality", "{\"term\":\"transsexuality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|sexuality|lang\u003den}} or {{suffix|transsexual|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state, condition, or properties of being transsexual\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The psychological diagnosis of gender identity disorder\", \"priority\":2}]}, \"synonyms\":{\"list\":[{\"text\":\"transsex\", \"synonymQualifier\":\"RARE\"}]}}");

	add("transshipment", "{\"term\":\"transshipment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trans|shipment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transfer of goods from one means of transport to another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The shipment of goods via an intermediate destination\", \"priority\":2}]}, \"synonyms\":{}}");

	add("transvaal", "{\"term\":\"transvaal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Geographical region in South Africa between the Vaal and Limpopo rivers. Was a province until 1994\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transvaluation", "{\"term\":\"transvaluation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A second or subsequent valuation made using a different standard or principle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transvestism", "{\"term\":\"transvestism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|transvest|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being a transvestite, or of transvesting\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transvestophilia", "{\"term\":\"transvestophilia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sexual arousal from transvestism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("transylvania", "{\"term\":\"transylvania\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the Latin preposition \u0027tran. Latin|trans\u0027 (meaning \u0026quot;across\u0026quot;) + \u0027silvam\u0027, the accusative singular of \u0027silva\u0027 meaning \u0026quot;forest\u0026quot;. Meaning \u0026quot;across the forest\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A region in the west of Romania\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trapball", "{\"term\":\"trapball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|trap|ball|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A game in which a batsman makes a ball hit a trap (device) that sends the ball into the air, from where the batsman has to hit it again\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trapeze", "{\"term\":\"trapeze\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027trapèze\u0027 from Latin \u0027trapezium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A trapezium\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A swinging horizontal bar, suspended at each end by a rope; \u0026amp;mdash; used by gymnasts\", \"priority\":2}]}, \"synonyms\":{}}");

	add("trapezoid", "{\"term\":\"trapezoid\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027τραπέζιον\u0027 (irregular quadrilateral) + \u0027-oid\u0027 (resembling)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A (convex) quadrilateral with two (non-adjacent) parallel sides\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A convex quadrilateral with no sides parallel and no equal sides\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The trapezoid bone of the wrist\", \"priority\":3}]}, \"synonyms\":{}}");

	add("trapper", "{\"term\":\"trapper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|trappen|er|lang\u003dnl}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who traps animals; one who makes a business of trapping animals for their furs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A boy who opens and shuts a trapdoor in a gallery or level\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ornamental covering for a horse. See trapping/caparison\", \"priority\":3}]}, \"synonyms\":{}}");

	add("trapshooting", "{\"term\":\"trapshooting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The sport, similar to skeet, of shooting at thrown targets with a shotgun\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trapunto", "{\"term\":\"trapunto\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian \u0027lang\u003dit\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of quilting producing a raised surfac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the Proenza Schouler line could be described as representing the best of their past hits: a palm print skirt for $24.99, a hooded cotton anorak for $39.99, a silk camisole with \u0027\u0027trapunto\u0027\u0027 topstitching for $49.99\", \"priority\":2}]}, \"synonyms\":{}}");

	add("trash", "{\"term\":\"trash\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old norse\"], \"text\":\"Probably a dialectal form of {{m|en|*trass}} (compare Orkney \u0027truss\u0027 English dialectal \u0027trous\u0027 , from Old norse \u0027tros|lang\u003dnon\u0027 () Compare Norwegian \u0027trask\u0027 (lumber, trash, baggage) Swedish \u0027trasa\u0027 (rag, cloth, worthless fellow) Swedish \u0027trås\u0027 (dry fallen twigs, wood-waste) Compare also Old English \u0027þreahs\u0027 \u0027þreax\u0027 (rottenness, rubbish)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Useless things to be discarded; rubbish; refuse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Lando\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A haunch of venison would be \u0027\u0027trash\u0027\u0027 to a Brahmin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A container into which things are discarded\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something worthless or of poor quality\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"People of low social status or class\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Temporary storage on disk for files that the user has deleted, allowing them to be recovered if necessary\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A collar, leash, or halter used to restrain a dog in pursuing game\", \"priority\":8}]}, \"synonyms\":{}}");

	add("trashery", "{\"term\":\"trashery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|trash|ery|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A collection of garbage, of things that resemble rubbish, or of things, persons, ideas, etc that are considered to be of no significant value\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1813\u0027\u0027, w:Walter Sir Walter Scott, \u0027The Bridal of Triermain\u0027, [https://www.google.ca/search?q\u003dtrashery+site%3Awww.online-literature.com+-%22network+forums%22\u0026amp;ie\u003dutf-8\u0026amp;oe\u003dutf-8\u0026amp;aq\u003dt\u0026amp;rls\u003dorg.mozilla:en-US:official\u0026amp;client\u003dfirefox-a\u0026amp;channel\u003dsb\u0026amp;gfe_rd\u003dcr\u0026amp;ei\u003ddVZLU6yCH-SM8QeS-IDoC\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"channel\u003dsb\u0026amp;q\u003dsite:www.gutenberg.org+%22+foreign+trashery%22\u0026amp;rls\u003dorg.mozilla:en-US:official (Google search result at \u0027gutenberg.org\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Who comes in foreign \u0027\u0027trashery\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Of tinkling chain and spur\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A walking haberdasher\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Of feathers, lace, and fur\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1859\u0027\u0027, John W. Burgon, \u0027The Portrait of a Christian Gentleman: A Memoir of Patrick Fraser Tytler\u0027, [http://books.google.ca/books?id\u003dXzgBAAAAQAAJ\u0026amp;pg\u003dPA92\u0026amp;dq\u003dtrashery+-Ogden+-foreign\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dLVxLU6vKM4-_2QWP0YD4DA\u0026amp;ved\u003d0CEQQ6AEwBDg\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dtrashery%20-Ogden%20-foreign\u0026amp;f\u003dfalse p. 92 (Google preview\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"I took four sketches of the different head-dresses, all equally detestable, which I shall finish and bring to shew you how far superior the natural beauty of our own girls in their simple dresses is to the \u0027\u0027trashery\u0027\u0027 of the French belles\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027 June, Robert A. Flammang, \u0026quot;Communications,\u0026quot; \u0027Journal of Economic Issues\u0027, vol. 3, no. 2, pp. 217-18\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"But it is not altogether funny to visualize our libraries becoming \u0027\u0027trasheries\u0027\u0027, our Centers of Learning objects of public ridicule and our occupations irrelevant to the world that is coming to be\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027 Jan. 3, w:Judith Judith Crist, \u0026quot;Movies,\u0026quot; \u0027New York Magazine\u0027, [http://books.google.ca/books?id\u003da6Bfz1a8X8YC\u0026amp;pg\u003dPA47\u0026amp;dq\u003dtrashery+-Ogden\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dloVMU_uRGsXs2QWe44AY\u0026amp;ved\u003d0CD8Q6AEwA\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dtrashery%20-Ogden\u0026amp;f\u003dfalse p. 47 (Google preview\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"So our list of the Ten Worst is carefully culled from the \u0027\u0027trashery\u0027\u0027 of \u0027Doctors\u0027 Wives\u0027 or \u0027The Seven Minutes\u0027 or \u0027Percy\u0027 and \u0027The Statue\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, w:Ed Ed Sanders, \u0027America: A History in Verse, Volume 1\u0027, ISBN 9781574231175, [http://books.google.ca/books?id\u003dMZzcGwmsnCIC\u0026amp;pg\u003dPA175\u0026amp;dq\u003dtrashery+-Ogden+-foreign\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dWmBLU_jYEIHx2wWFwYHQDg\u0026amp;ved\u003d0CDsQ6AEwAjg\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dtrashery%20-Ogden%20-foreign\u0026amp;f\u003dfalse p. 175 (Google preview\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"this tasteless rightwing \u0027\u0027trashery\", \"priority\":18}]}, \"synonyms\":{}}");

	add("trashsport", "{\"term\":\"trashsport\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|trash|sport|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An entertainment that is supposedly a sport but has no real sporting content\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trastuzumab", "{\"term\":\"trastuzumab\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A drug used in the treatment of breast cancer which targets the HER-2 oncogene\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trauma", "{\"term\":\"trauma\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027τραῦμα\u0027 (wound, damage)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any serious injury to the body, often resulting from violence or an accident\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An emotional wound leading to psychological injury\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An event that causes great distress\", \"priority\":3}]}, \"synonyms\":{}}");

	add("traumatology", "{\"term\":\"traumatology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027trauma\u0027 and the suffix \u0027-ology\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A branch of medicine that deals with the diagnosis and treatment of trauma\", \"priority\":1}]}, \"synonyms\":{}}");

	add("traunch", "{\"term\":\"traunch\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"Late Anglo-norman \u0027traunche\u0027 (Old French \u0027tranche\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of a series of allotments (of funds for a certain purpose\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, George W. Bush, \u0027speech following tsunami disaster\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"First of all, we provide immediate cash relief to the tune of about $35 million. And then there will be an assessment of the damage, so that the relief is -- the next \u0027\u0027traunch\u0027\u0027 of relief will be spent wisely\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One set or portion of a series\", \"priority\":4}]}, \"synonyms\":{}}");

	add("trave", "{\"term\":\"trave\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Middle french (ca. 1400-1600) \u0027trave\u0027 from Latin \u0027trabem\u0027 () accusative of \u0027trabs\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A crossbeam\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A section formed by crossbeams\", \"priority\":2}]}, \"synonyms\":{}}");

	add("travail", "{\"term\":\"travail\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027travail\u0027 (suffering, torment)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Arduous or painful exertion; excessive labor, suffering, hardship\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Hooke\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As everything of price, so this doth require \u0027\u0027travail\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"II.20\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Travell\u0027\u0027 and pleasure, most unlike in nature, are notwithstanding followed together by a kind of I wot not what natural conjunction\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027, \u0027Nightwood\u0027, Faber \u0026amp; Faber 2007, p. 38\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He had thought of making a destiny for himself, through laborious and untiring \u0027\u0027travail\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the labor of childbirth\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An act of working; labor , labour\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The eclipse of a celestial object\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"lt;!--separate ety?--\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"lt;!--separate ety?--\u0026gt\", \"priority\":12}]}, \"synonyms\":{}}");

	add("travelator", "{\"term\":\"travelator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{wikipedia}}{{blend|travel|escalator|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A moving walkway; a slow conveyor belt that transports people horizontally or on an incline in a similar manner to an escalator\", \"priority\":1}]}, \"synonyms\":{}}");

	add("traveler", "{\"term\":\"traveler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|travel|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Carried somehow, somewhither, for some reason, on these surging floods, were these \u0027\u0027travelers\u0027\u0027, of errand not wholly obvious to their fellows, yet of such sort as to call into query alike the nature of their errand and their own relations\", \"priority\":1}]}, \"synonyms\":{}}");

	add("traveller", "{\"term\":\"traveller\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|travel|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who travels, especially to distant lands\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL10504990W The Lonely passage\u003dThe desert storm was riding in its strength; the \u0027\u0027travellers\u0027\u0027 lay beneath the mastery of the fell simoom. Whirling wreaths and columns of burning wind, rushed around and over them\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A modern-day gypsy, tinker, caravan dweller, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A member of the nomadic ethnic minority\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A list and record of instructions that follows a part in a manufacturing process\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A metal ring that moves freely on part of a ship’s rigging\", \"priority\":6}]}, \"synonyms\":{}}");

	add("travelling", "{\"term\":\"travelling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"action of the verb \u0027to travel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("traverse", "{\"term\":\"traverse\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027traverser\u0027 from Latin \u0027\u0027trans\u0027\u0027 \u0027across\u0027 + \u0027\u0027versus\u0027\u0027 \u0027turned\u0027, perfect passive participle of \u0027\u0027vertere\u0027\u0027, \u0027turn\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A route used in mountaineering, specifically rock climbing, in which the descent occurs by a different route than the ascent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In fortification, a mass of earth or other material employed to protect troops against enfilade. It is constructed at right angles to the parapet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A series of points, with angles and distances measured between, traveled around a subject, usually for use as \u0026quot;control\u0026quot; i.e. angular reference system for later surveying work\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A screen or partition\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1499\u0027\u0027, \u0027The Bowge of Court\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Than sholde ye see there pressynge in a pace / Of one and other that wolde this lady see, / Whiche sat behynde a \u0027\u0027traves\u0027\u0027 of sylke fyne, / Of golde of tessew the fynest that myghte be\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"F. Beaumon\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"At the entrance of the king, / The first \u0027\u0027traverse\u0027\u0027 was drawn\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Something that thwarts or obstructs\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He would have succeeded, had it not been for unlucky \u0027\u0027traverses\u0027\u0027 not under his control\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A trick; a subterfuge\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A gallery or loft of communication from side to side of a church or other large building\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A formal denial of some matter of fact alleged by the opposite party in any stage of the pleadings. The technical words introducing a traverse are \u0027absque hoc\u0027 (\u0026quot;without this\u0026quot;, i.e. without what follows\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The zigzag course or courses made by a ship in passing from one place to another; a compound course\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A line lying across a figure or other lines; a transversal\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The turning of a gun so as to make it point in any desired direction\", \"priority\":16}]}, \"synonyms\":{}}");

	add("travertine", "{\"term\":\"travertine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"Image:TravertineUSGOV.jpg|thumb|TravertineFrom Italian \u0027\u0027 earlier \u0027\u0027 from Latin \u0027tiburtinus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A light, porous form of concretionary limestone (or calcite) deposited from solution, and sometimes quarried for building\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027Super-Cannes\u0027, Fourth Estate 2011, p. 191\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Halder stopped outside a seven-storey building sheathed in pale \u0027\u0027travertine\u0027\u0027 marble\", \"priority\":3}]}, \"synonyms\":{}}");

	add("travesty", "{\"term\":\"travesty\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027lang\u003dfr|travestir\u0027 () from Latin \u0027lang\u003dla|trans\u0027 () + \u0027lang\u003dla|vestire\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An absurd or grotesque misrepresentation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"De Quince\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The second edition is not a recast, but absolutely a \u0027\u0027travesty\u0027\u0027 of the first\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A parody or stylistic imitation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A grossly inferior imitation\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A battlefield trial is a \u0027\u0027travesty\u0027\u0027 of justice\", \"priority\":6}]}, \"synonyms\":{}}");

	add("travois", "{\"term\":\"travois\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From from an alteration of \u0027travail\u0027 (lang\u003dfr) (etymology 2), from \u0027trepalium\u0027 (lang\u003dla) probably a calque from Ancient greek (to 1453) See \u0027πάσσαλος\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A traditional North American Indian sled-like vehicle, pulled by person, dog, or horse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Julian Ralp\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"On the plains they will have horses dragging \u0027\u0027travoises\u0027\u0027, dogs with travoises, women and children loaded with impedimenta\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Cormac McCarthy, \u0027The Crossing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Riding out for wood he watched his shadow and the shadow of the horse and \u0027\u0027travois\u0027\u0027 cross those palings tree by tree\", \"priority\":5}]}, \"synonyms\":{}}");

